Having issues matching local and foreign fields in a $lookup pipeline for a MongoDB aggregate query<p>I have a two different collections, one for <em>emailtemplates</em>, and one for <em>emails</em>. And what I'm trying to do is write an aggregate pipeline that will show how many times each template has been sent using the templates <em>name</em> from the <em>emailtemplates</em> collection. I know I could just execute a pipeline on the <em>emails</em> collection and count each one by the template name, but that will exclude templates that have never been sent.</p>
<p>Here are some example documents I worked up...</p>
<pre class="lang-json prettyprint-override"><code>// Example emailtemplate documents:
