      &quot;name&quot;: &quot;firstname&quot;,
      &quot;type&quot;: &quot;string&quot;,
      &quot;required&quot;: true
    },{
      &quot;name&quot;: &quot;lastname&quot;,
      &quot;type&quot;: &quot;string&quot;,
      &quot;required&quot;: true
    }],
    &quot;body&quot;:&quot;Dear {firstname}, Welcome to the club&quot;
  },
  {
    &quot;name&quot;: &quot;GOODBYE-01&quot;,
    &quot;channel&quot;: &quot;email&quot;,
    &quot;status&quot;:&quot;active&quot;,
    &quot;title&quot;: &quot;Hello, welcome {firstname} {lastnane}&quot;,
    &quot;parameters&quot;:[{
      &quot;name&quot;: &quot;firstname&quot;,
      &quot;type&quot;: &quot;string&quot;,
      &quot;required&quot;: true
    },{
      &quot;name&quot;: &quot;lastname&quot;,
      &quot;type&quot;: &quot;string&quot;,
      &quot;required&quot;: true
    }],
    &quot;body&quot;:&quot;Dear {firstname}, were sorry to see you go&quot;
  },
  {
    &quot;name&quot;: &quot;YOURE-FIRED-01&quot;,
    &quot;channel&quot;: &quot;email&quot;,
    &quot;status&quot;:&quot;active&quot;,
    &quot;title&quot;: &quot;Hello, welcome {firstname} {lastnane}&quot;,
    &quot;parameters&quot;:[{
