    &quot;templateName&quot;: &quot;WELCOME-01&quot;,
    &quot;recipient&quot;: &quot;john.doe@gmail.com&quot;,
    &quot;parameters&quot;: {
      &quot;firstName&quot;: &quot;John&quot;,
      &quot;lastName&quot;: &quot;Doe&quot;
    }
  },
  {
    &quot;templateName&quot;: &quot;WELCOME-01&quot;,
    &quot;recipient&quot;: &quot;david.chappelle@gmail.com&quot;,
    &quot;parameters&quot;: {
      &quot;firstName&quot;: &quot;David&quot;,
