]
</code></pre>
<p>So you can see how each <em>email</em> document has the <em>templateName</em> value which matches with the <em>name</em> from each <em>emailtemplates</em> document. And what I'm trying to do is select from the <em>templateName</em> collection and show how many <em>emails</em> documents are associated to it.</p>
<p>I know how to do it using the <em>localField</em> and <em>foreignFIeld</em> options:</p>
<pre class="lang-js prettyprint-override"><code>db.notificationtemplates.aggregate([
  {
      $lookup:{
        from: &quot;notifications&quot;,
        localField: &quot;name&quot;,
        foreignField: &quot;templateName&quot;,
        as: &quot;notifications&quot;
      }
   },
   {
    $project:{
      _id: 0,
      templateName: &quot;$name&quot;,
      amountSent: { $size: &quot;$notifications&quot;}
    }
   }
 ]);
</code></pre>
<p>Which gives me the results:</p>
<pre class="lang-js prettyprint-override"><code>[
  { templateName: 'WELCOME-01', amountSent: 2 },
  { templateName: 'GOODBYE-01', amountSent: 1 },
  { templateName: 'YOURE-FIRED-01', amountSent: 0 }
}
</code></pre>
