<blockquote>
<p>MongoServerError: $lookup with 'pipeline' may not specify 'localField' or 'foreignField'</p>
</blockquote>
<p>Here's the query I've written thus far to try to do the same thing:</p>
<pre class="lang-js prettyprint-override"><code> db.emailtemplates.aggregate([
