NEXT JS AND MONGODB JWT integration<p>Looking for a backend dev that can simply help me implement MONGODB with nextJS and the current model I have now. I have bought <a href="https://www.devias.io" rel="nofollow noreferrer">https://www.devias.io</a> admin dashboard, and just want to implement auth and database reading with it.</p>
<p>Just want the basic auth setup. It's already setup in the FILES just wanting to know how to configure it properly based on the devias guides</p>
<p>Has anyone done this before I can't find any documentation on it
It's setup with mock data at the moment</p>
<p>SRC/API/AUTH/index.js</p>
<pre><code>import { createResourceId } from '../../utils/create-resource-id';
import { decode, JWT_EXPIRES_IN, JWT_SECRET, sign } from '../../utils/jwt';
import { wait } from '../../utils/wait';
import { users } from './data';

class AuthApi {
  async signIn(request) {
    const { email, password } = request;

    await wait(500);

    return new Promise((resolve, reject) =&gt; {
      try {
        // Find the user
        const user = users.find((user) =&gt; user.email === email);

        if (!user || (user.password !== password)) {
          reject(new Error('Please check your email and password'));
          return;
        }

        // Create the access token
        const accessToken = sign({ userId: user.id }, JWT_SECRET, { expiresIn: JWT_EXPIRES_IN });

        resolve({ accessToken });
      } catch (err) {
        console.error('[Auth Api]: ', err);
        reject(new Error('Internal server error'));
      }
    });
  }

  async signUp(request) {
    const { email, name, password } = request;

    await wait(1000);

    return new Promise((resolve, reject) =&gt; {
      try {
        // Check if a user already exists
        let user = users.find((user) =&gt; user.email === email);

        if (user) {
          reject(new Error('User already exists'));
          return;
        }

        user = {
          id: createResourceId(),
          avatar: undefined,
          email,
          name,
          password,
          plan: 'Standard'
        };

        users.push(user);

        const accessToken = sign({ userId: user.id }, JWT_SECRET, { expiresIn: JWT_EXPIRES_IN });

        resolve({ accessToken });
      } catch (err) {
        console.error('[Auth Api]: ', err);
        reject(new Error('Internal server error'));
      }
    });
  }

  me(request) {
    const { accessToken } = request;

    return new Promise((resolve, reject) =&gt; {
      try {
        // Decode access token
        const { userId } = decode(accessToken);

        // Find the user
        const user = users.find((user) =&gt; user.id === userId);

        if (!user) {
          reject(new Error('Invalid authorization token'));
          return;
        }

        resolve({
          id: user.id,
          avatar: user.avatar,
          email: user.email,
          name: user.name,
          plan: user.plan
        });
      } catch (err) {
        console.error('[Auth Api]: ', err);
        reject(new Error('Internal server error'));
      }
    });
  }
}

export const authApi = new AuthApi();

</code></pre>
<p>then /SRC/API/AUTH/data.js</p>
<pre><code>export const users = [
  {
    id: '5e86809283e28b96d2d38537',
    avatar: '/assets/avatars/avatar-anika-visser.png',
    email: 'demo@devias.io',
    name: 'Anika Visser',
    password: 'Password123!',
    plan: 'Premium'
  }
];
</code></pre>
<p>This is the documentation on it</p>
<h1>JSON Web Token (JWT)</h1>
<p>Most auth providers use this strategy under the hood to provide access tokens. Currently, the app doesn't cover the backend service, and this service is mocked (faked) using http client interceptors. The implementation is basic, but enough to give you a starting point.</p>
<h2>How it was implemented</h2>
<p>Since tokens are meant to be created on the backend server, they are built with encrypt, encode and decode utility methods because they are not meant to be used on the client. These utilities can be found in <code>src/utils/jwt</code>. These are for development purposes only, and you must remove (or avoid using) them.</p>
<h2>How to use JWT Provider</h2>
<p>The app is delivered with JWT Provider as default auth strategy. If you changed or removed it, and you want it back, simply follow these steps:</p>
<ul>
<li>Step 1: Import the provider</li>
</ul>
<p>Open <code>src/pages/_app.js</code> file, import the provider and wrap the App component with it.</p>
<pre><code>// src/pages/_app.js
import { AuthConsumer, AuthProvider } from '../contexts/auth/jwt-context';

const App = (props) =&gt; {
  const { Component, pageProps } = props;

  return (
    &lt;AuthProvider&gt;
      &lt;Component {...pageProps} /&gt;
    &lt;/AuthProvider&gt;
  );
};
</code></pre>
<ul>
<li>Step 2: Set the hook context</li>
</ul>
<p>Open <code>src/hooks/use-auth.js</code> file and replace the current context the following line:</p>
<pre class="lang-js prettyprint-override"><code>import { AuthContext } from '../contexts/auth/jwt-context';
</code></pre>
<h2>How to use auth</h2>
<h3>Retrieve user profile</h3>
<p>In the example below, you can find how it can be used in any component not just the <code>App</code>. Should you want to use it in any other component, you'll have to import the <code>useAuth</code> hook and use it as needed.</p>
<pre><code>// src/pages/index.js
import { useAuth } from '../hooks/use-auth';

const Page = () =&gt; {
  const { user } = useAuth();

  return (
    &lt;div&gt;
      Email: {user.email}
    &lt;/div&gt;
  );
};
</code></pre>
<h3>Auth methods / actions</h3>
<p>For simplicity and space limitations, the code below is used only to exemplify, actual code can be found in the components.</p>
<pre><code>// src/pages/index.js
import { useAuth } from '../hooks/use-auth';

const Page = () =&gt; {
  const { login } = useAuth();

  const handleLogin = () =&gt; {
    // Email/username and password
    login('demo@devias.io', 'Password123!');
  };
s
  return (
    &lt;div&gt;
      &lt;button onClick={handleLogin}&gt;
        Login
      &lt;/button&gt;
    &lt;/div&gt;
  );
};
</code></pre>
<h2>Implemented flows</h2>
<p>Currently, the app only covers the main flows:</p>
<ul>
<li>Register</li>
<li>Login</li>
<li>Logout</li>
</ul>

