Is it possible to use a variable object inside collection.find() in mongoose?<p>Context:
I am trying to code the back end of an &quot;Advanced Search&quot; option
It is a project I'm coding to practice JS, MongoDB(Mongoose), Next, Node, Etc.</p>
<p>The Schema I'm using is the following:</p>
<pre><code>House Schema:{
 name:String,
 address:{
   street:String
   city:String,
   state:String
   },
 operations:{
   rent:Boolean, 
   shortRent:Boolean, 
   purchase:Boolean,
   agentRentPrice:Number,
   agentShortRentPrice:Number,
   agentSellingPrice:Number},
 features:{
   bathrooms:Number,
   bedrooms:Number,
   beds:Number,
   amenities:[String],
   },
}
</code></pre>
<p>Now, the FrontEnd sends the following info (in req.body):</p>
<pre><code>query = {
  name: null,
  address: { city: null, state: null },
  operations: {
    rentAvailable: false,
    purchaseAvailable: false,
    shortRentAvailable: false,
    agentRentPriceMin: null,
    agentSellingPriceMin: null,
    agentShortRentPriceMin: null,
    agentRentPriceMax: null,
    agentSellingPriceMax: null,
    agentShortRentPriceMax: null,
  },
  features: {
    bathroomsMin: null,
    dormsMin: null,
    bedsMin: null,
    amenities: null,
  },
}
</code></pre>
<p>Of course, those &quot;null&quot; values will be replaced with numbers or strings with the parameters introduced by the user.</p>
<p>With this object, I then declare another:</p>
<pre><code>let queryObj = {
  name: query.name,
  address: { city: query.address.city, state: query.address.state },
  operations: {
    rentAvailable: query.operations.rentAvailable,
    purchaseAvailable: query.operations.purchaseAvailable,
    shortRentAvailable: query.operations.shortRentAvailable,
    agentRentPrice: {
      $gte: query.operations.agentRentPriceMin,
      $lte: query.operations.agentRentPriceMax,
    },
    agentSellingPrice: {
      $gte: query.operations.agentSellingPriceMin,
      $lte: query.operations.agentSellingPriceMax,
    },
    agentShortRentPrice: {
      $gte: query.operations.agentShortRentPriceMin,
      $lte: query.operations.agentShortRentPriceMax,
    },
  },
  features: {
    bathrooms: { $gte: query.features.bathroomsMin },
    dorms: { $gte: query.features.dormsMin },
    beds: { $gte: query.features.bedsMin },
    amenities: { $in: query.features.amenities },
  },
}
</code></pre>
<p>Finally I reduce this object, removing any &quot;null&quot;, &quot;false&quot;, &quot;&quot; and &quot;{}&quot; values.</p>
<p>For example, the user searches for: house available for renting, in New York, with 2 bedrooms, with a pool, and max Rent price of $10.000</p>
<p>So, req.body.query will be</p>
<pre><code>{
  name: null,
  address: { city: &quot;New York&quot;, state: null },
  operations: {
    rentAvailable: true,
    purchaseAvailable: false,
    shortRentAvailable: false,
    agentRentPriceMin: null,
    agentSellingPriceMin: null,
    agentShortRentPriceMin: null,
    agentRentPriceMax: 10000,
    agentSellingPriceMax: null,
    agentShortRentPriceMax: null,
  },
  features: {
    bathroomsMin: null,
    dormsMin: 2,
    bedsMin: null,
    amenities: [&quot;pool&quot;],
  },
}
</code></pre>
<p>Next, I declare</p>
<pre><code>let queryObj = {
  name: null,
  address: { city: &quot;New York&quot;, state: null },
  operations: {
    rentAvailable: true,
    purchaseAvailable: false,
    shortRentAvailable: false,
    agentRentPrice: {
      $gte: null,
      $lte: 10000,
    },
    agentSellingPrice: {
      $gte: null,
      $lte: null,
    },
    agentShortRentPrice: {
      $gte: null,
      $lte: null,
    },
  },
  features: {
    bathrooms: { $gte: null },
    dorms: { $gte: 2 },
    beds: { $gte: null },
    amenities: { $in: [&quot;pool&quot;] },
  },
};
</code></pre>
<p>I have a function here that reduces this object (removing &quot;false&quot; &quot;null&quot; &quot;&quot; and &quot;{}&quot; values):</p>
<pre><code>
queryObj = {
  address: { city: &quot;New York&quot; },
  operations: {
    rentAvailable: true,
    agentRentPrice: {
      $lte: 10000,
    },
  },
  features: {
    dorms: { $gte: 2 },
    amenities: { $in: [&quot;pool&quot;] },
  },
};
</code></pre>
<p>As you can see, &quot;query&quot; (and therefore &quot;queryObj&quot;) will vary a lot; the user may or may not use any of the available search parameters, so (as i see it) it is not possible to &quot;hard-code&quot; the queryObj structure</p>
<p>I've tried using</p>
<pre><code>Home.aggregate([{$match:queryObj}]) 
</code></pre>
<p>without success (returns no results).</p>
<p>Is it possible what I'm trying to do?</p>

